import React from "react";

const Pokemon = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-12 text-center">
          <h1>Michael's PC</h1>
          <p>
            <a
                href="https://honchkrow.com"
                target="_blank"
                rel="noopener noreferrer"
            >
                Honchkrow{' '}
            </a>
          </p>
          <p>
            <a
                href="https://kricketune.com"
                target="_blank"
                rel="noopener noreferrer"
            >
                Kricketune{' '}
            </a>
          </p>
        </div>
      </div>
    </div>
  );
};

export default Pokemon;
